import React, { Component } from "react";

import TableFilters, {
  InputDescriptor,
} from "../../components/QueryView/TableFilters/TableFilters";
import DynamicTable from "../../components/QueryView/DynamicTable/DynamicTable";
type Props = {};

const Services: React.FC<Props> = ({}) => {
  const filterElements = [
    { name: "id", type: "text", placeholder: "Id" },
    {
      name: "numero_documento",
      type: "text",
      placeholder: "Numero de documento",
    },
    {
      name: "primer_nombre",
      type: "text",
      placeholder: "Primer nombre",
      upCase: true,
    },
    {
      name: "primer_apellido",
      type: "text",
      placeholder: "Primer apellido",
      upCase: true,
    },
    {
      name: "fecha_inicio",
      type: "date",
      placeholder: "Fecha inicio",
    },
    {
      name: "fecha_fin",
      type: "date",
      placeholder: "Fecha fin",
      value: "1990-12-12",
    },
    {
      name: "estado",
      type: "select",
      placeholder: "Estado",
      items: [
        { key: "1", value: "Pendiente" },
        { key: "2", value: "Aprobado" },
        { key: "3", value: "Rechazado" },
      ],
      selectedItemKey: "",
    },
    {
      name: "tipo",
      type: "select",
      placeholder: "Tipo",
      items: [
        { key: "1", value: "Medico" },
        { key: "2", value: "Enfermera" },
        { key: "3", value: "Jefe" },
      ],
      selectedItemKey: "",
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Buscar",
      classes: ["btn", "btn-primary"],
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Exportar V1",
      classes: ["btn", "btn-warning"],
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Exportar V2",
      classes: ["btn", "btn-warning"],
    },
  ];
  let tableHeaders = [
    "Id",
    "Estado",
    "Tipo",
    "Categoria",
    "Empresa Asignada",
    "Solicitante",
    "Fecha",
  ];
  let data = [
    {
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["create", "create"],
    },
    {
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["create", "create"],
    },
    {
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["create", "create"],
    },
  ];
  const actions = {
    create: {
      theClass: "btn btn-primary",
      label: "Create",
    },
  };

  let actionTriggered = () => {
    alert("Lets edit ...");
  };

  return (
    <>
      <div className="container-fluid">
        <h1>
          Consulta <small>Servicios</small>
        </h1>
        <div className="row">
          <TableFilters elements={filterElements} />
          <div className="col-10">
            <div className="container-fluid">
              <div className="table-responsive">
                <DynamicTable
                  headers={tableHeaders}
                  data={data}
                  actions={actions}
                  onActionTriggered={() => actionTriggered()}
                />
              </div>
            </div>

            <div className="container">
              <div>TablePaginator</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
